import React, { useState } from "react";

const AuthForm = () => {
  const [isSignIn, setIsSignIn] = useState(true);
  const [emailOrPhone, setEmailOrPhone] = useState("");
  const [password, setPassword] = useState("");
  // Additional state for sign-up mode
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");

  const handleSubmit = (event) => {
    event.preventDefault();
  
    const userEndpoint = 'http://localhost/Tarea3/backend/src/index.php/login';
    const professionalEndpoint = 'http://localhost/Tarea3/backend/src/index.php/loginProfessional';
  
    const endpoint = isSignIn ? userEndpoint : professionalEndpoint;
    const userData = {
      email: emailOrPhone, // Your backend PHP is looking for an 'email' field
      password: password,
      // Add any other fields your backend requires
    };
  
    // If registering, append additional data
    if (!isSignIn) {
      userData.firstName = firstName;
      userData.lastName = lastName;
      // If you have confirmPassword in your backend model
      userData.confirmPassword = confirmPassword;
    }
  
    fetch(endpoint, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json', // Assuming your backend can parse JSON
        // Add any other headers your backend requires
      },
      body: JSON.stringify(userData),
    })
    .then((response) => {
      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }
      return response.json();
    })
    .then((data) => {
      // Handle the data from the backend
      console.log(data);
      // Update your state and/or UI here
    })
    .catch((error) => {
      console.error('There was an error!', error);
    });
  };

  const toggleMode = () => {
    setIsSignIn(!isSignIn);
  };

  return (
    <div className="user-form-area ptb-100">
      <div className="container">
        <div className="user-item">
          <h2>{isSignIn ? "Sign In" : "Sign Up"}</h2>
          <form onSubmit={handleSubmit}>
            <div className="row">
              {!isSignIn && (
                <>
                  <div className="col-lg-12">
                    <div className="form-group">
                      <input
                        type="text"
                        className="form-control"
                        placeholder="First Name"
                        value={firstName}
                        onChange={(e) => setFirstName(e.target.value)}
                      />
                    </div>
                  </div>
                  <div className="col-lg-12">
                    <div className="form-group">
                      <input
                        type="text"
                        className="form-control"
                        placeholder="Last Name"
                        value={lastName}
                        onChange={(e) => setLastName(e.target.value)}
                      />
                    </div>
                  </div>
                </>
              )}
              <div className="col-lg-12">
                <div className="form-group">
                  <input
                    type={isSignIn ? "text" : "email"}
                    className="form-control"
                    placeholder={isSignIn ? "Email or Phone" : "Email"}
                    value={emailOrPhone}
                    onChange={(e) => setEmailOrPhone(e.target.value)}
                  />
                </div>
              </div>
              <div className="col-lg-12">
                <div className="form-group">
                  <input
                    type="password"
                    className="form-control"
                    placeholder="Password"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                  />
                </div>
              </div>
              {!isSignIn && (
                <div className="col-lg-12">
                  <div className="form-group">
                    <input
                      type="password"
                      className="form-control"
                      placeholder="Confirm Password"
                      value={confirmPassword}
                      onChange={(e) => setConfirmPassword(e.target.value)}
                    />
                  </div>
                </div>
              )}
              <div className="col-lg-12">
                <button type="submit" className="btn cmn-btn">
                  {isSignIn ? "Sign In" : "Sign Up"}
                </button>
                <span> Or </span>
                <button
                  type="button"
                  className="btn-toggle"
                  onClick={toggleMode}
                >
                  {isSignIn ? "Sign Up" : "Sign In"}
                </button>
              </div>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default AuthForm;
